import React from "react";
// import VesselDummyData from "../utils/VesselDummyData"


    class VesselList extends React.Component {
        constructor(props) {
            super(props);
            this.state = {
                boats: []
            }
        }

        componentDidMount() {
            API.searchEmployee()
                .then(res => this.setState({ employees: res.data.results, results: res.data.results }))
                .catch(err => console.log(err));
        }

        render() {

            return (
                <div>
                    <h1>Boats land here</h1>
                    {/* <VesselDummyData /> */}
                </div>
            )
        
        }

    }




export default VesselList
